    <title>TEAM COBRAS: San Francisco Violations</title>
    <style>
      /* Always set the map height explicitly to define the size of the div
       * element that contains the map. */
      #map {
        height: 100%;
      }
      /* Optional: Makes the sample page fill the window. */
      html, body {
        height: 100%;
        margin: 0;
        padding: 0;
      }
      #legend {
	    font-family: Arial, sans-serif;
	    background: #fff;
	    padding: 5px;
	    margin: 5px;
	    border: 2px solid #333;
	  }
    </style>

  <body>
    <div id="map"></div>
    <div id="legend"></div>
    <script>
    /* data_size - how many intervals (i.e. weeks) to combine and display at once
     * data_step - how many intervals to step over for next data set. Make less than data_size to overlap
     * Display <data_size> intervals at a time, step through <data_step> intervals for next display.
	 *
	 * heatmap - display heatmap style map
	 * clustermap - display cluster style map
	 * Both map types can be active at once (for what it's worth)
     */
	var options = {
		data_size: 4,
		data_step: 2,
		pause_duration: 2000,
		map: {
			zoom: 14,
			center: {lat: 37.783, lng: -122.440},
			mapTypeId: 'satellite',
			cluster_radius: 25
		},
		heatmap: 1,
		clustermap: 1
	}
	var map;
	var heatmap, clustermap;
	var markers = [];
	var data_incr = -1;
	var data_list = [];

	function init() {
        map = new google.maps.Map(document.getElementById('map'), options.map);
        map.controls[google.maps.ControlPosition.LEFT_TOP].push(document.getElementById('legend'));
        
		heatmap = new google.maps.visualization.HeatmapLayer({
			data: [],
			radius: options.map.cluster_radius
		});
	    clustermap = new MarkerClusterer(map, [],
	    {imagePath: 'https://developers.google.com/maps/documentation/javascript/examples/markerclusterer/m'});
		
		map.addListener('zoom_changed', function() {
          options.map.zoom = map.getZoom();
        });
        map.addListener('center_changed', function() {
        	options.map.center = {lat: map.getCenter().lat(), lng:map.getCenter().lng()};
        });

        parseData();
        renderMap();

	}

	function parseData() {
		var crnt_wk = data[0].week;
		var crnt_interval = {from: data[0].date, to:'',locs: []};
		var crnt_locs = [];
		for (var i=0, len=data.length; i<len; i++) {
			if (data[i].week != crnt_wk) {
				crnt_interval.locs = crnt_locs;
				data_list.push(crnt_interval);
				crnt_locs = [];
				crnt_wk = data[i].week;
				crnt_interval = {from: data[i].date, to:'',locs: []};
			}
			crnt_interval.to = data[i].date;
			crnt_locs.push(data[i].loc);
		}
	}

	function renderMap() {
		var loc_data = [];
		if ((data_incr+options.data_step) >= data_list.length-1 ) {
			data_incr = 0;
		} else {
			data_incr += options.data_step;
		}
		next_sets = Math.min(options.data_size, (data_list.length-1)-data_incr);

		for (var i = 0; i < next_sets; i++) {
			loc_data.push.apply(loc_data, data_list[data_incr+i].locs);
		}
		document.getElementById('legend').innerHTML = '<b>Date Range:</b><br />'+data_list[data_incr].from + '<br />' + data_list[data_incr+next_sets].to;

		if (options.heatmap) {
			heatmapData = loc_data.map(function(location, i) {
			  return new google.maps.LatLng(location.lat, location.lng);
			});

			heatmap.setMap(null);
			heatmap = new google.maps.visualization.HeatmapLayer({
				data: heatmapData,
				radius: options.map.cluster_radius
			});
			heatmap.setMap(map);
		}

		if ( options.clustermap) {
			clusterData = loc_data.map(function(location, i) {
			  return new google.maps.Marker({position: location});
			});

			clustermap.clearMarkers();
		    clustermap = new MarkerClusterer(map, clusterData,
		    {imagePath: 'https://developers.google.com/maps/documentation/javascript/examples/markerclusterer/m'});
		}

		setTimeout(function(){ renderMap(); }, options.pause_duration);
	}
